import React from 'react';
import { Button } from '@mui/material';
import axios from 'axios';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import Grid from '@mui/material/Grid';

const WeatherPage = () => {
    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
      setAge(event.target.value);
    };
   
return (
    <>

<Grid container spacing={2} style={{pad}}>
    <Grid item xs={12} md={3}> 
    </Grid>
    <Grid item xs={12} md={6}> 
  <Box sx={{ minWidth: 120 }} >
    <FormControl fullWidth>
      <InputLabel id="demo-simple-select-label">Age</InputLabel>
      <Select
        labelId="demo-simple-select-label"
        id="demo-simple-select"
        value={age}
        label="Age"
        onChange={handleChange}
      >
        <MenuItem value={10}>Ten</MenuItem>
        <MenuItem value={20}>Twenty</MenuItem>
        <MenuItem value={30}>Thirty</MenuItem>
      </Select>
    </FormControl>
  </Box>
    </Grid>
    <Grid item xs={12} md={3}> 
    </Grid>
</Grid>    


        <Button onClick={()=>{
            axios.get("https://api.openweathermap.org/data/2.5/weather?lat=24.8607&lon=67.0011&units=metric&appid=bafb9353ed5fd0e37e467321085b9d27").
            then((res)=>{
                console.log(res.data);
            }).catch((err)=>{
                console.log(err.message);
            })

        }}>Test</Button>


        <h1>weather Updates will come here</h1>

        </>
     );
}
 
export default WeatherPage;
